description:
Sara hates her stepmother Carla. After Carla throws Sara out of the house, Sara is kidnapped by Mark and Beth. Mark and Beth need money for invitro fertilizations. They want to have a baby. They can't adopt because of Mark's criminal past . . . He's a killer!

